    const day = useParams();
    console.log(day)

    return (
        <div>
            <h2 style={{margin: "40px auto"}}>
                <span style={{backgroundColor:"lemonchiffon", borderRadius:"20px"}}>화요일 </span>평점 남기기
            </h2>

        </div>
    )
}

export default Daily
